import Shared from "pages/Shared";
import { BrowserRouter, Routes, Route } from "react-router-dom";
function App() {
  return (
    <BrowserRouter>
      <Routes>
        {/* <Route path="/folder" element={<Shared />} /> */}
        <Route path="/" element={<Folder />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
